function Header() {
    return (
        <div className="header">
            <header className="app-header">
                <img src={'assets/Icon.png'}></img>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
            </header>
        </div>
    );
}

export default Header;
